              <Col span={24}>
                <Row justify="center" gutter={[24, 24]}>
                  <Col span={24}>
                    <Row gutter={[16, 0]} justify="center">
                      <Col>
                        <Tooltip title="(予約人数/参加可能最大人数)*100">
                          <StyledProgressBar
                            type="dashboard"
                            strokeColor="#9ff0fc"
                            percent={findPercentage(
                              occasion.sumExpected || 0,
                              occasion.maxCapacity || 0
                            )}
                            format={(percent) =>
                              `予約率\u000A\u000A${percent}%`
                            }
                          />
                        </Tooltip>
                      </Col>
                      <Col>
